:\"content\";i:3;s:5:\"image\";i:4;s:6:\"status\";}s:10:\"\0*\0guarded\";a:1:{i:0;s:1:\"*\";}}i:2;O:15:\"App\\Models\\News\":33:{s:13:\"\0*\0connection\";s:5:\"mysql\";s:8:\"\0*\0table\";s:4:\"news\";s:13:\"\0*\0primaryKey\";s:2:\"id\";s:10:\"\0*\0keyType\";s:3:\"int\";s:12:\"incrementing\";b:1;s:7:\"\0*\0with\";a:0:{}s:12:\"\0*\0withCount\";a:0:{}s:19:\"preventsLazyLoading\";b:0;s:10:\"\0*\0perPage\";i:15;s:6:\"exists\";b:1;s:18:\"wasRecentlyCreated\";b:0;s:28:\"\0*\0escapeWhenCastingToString\";b:0;s:13:\"\0*\0attributes\";a:8:{s:2:\"id\";i:151;s:6:\"status\";s:9:\"published\";s:5:\"title\";s:78:\"Dirjenpas Cek Lapas Nabire Usai 19 Napi Kabur, Jenguk Sipir Korban Penyerangan\";s:4:\"slug\";s:77:\"dirjenpas-cek-lapas-nabire-usai-19-napi-kabur-jenguk-sipir-korban-penyerangan\";s:7:\"content\";s:848:\"<div>Nabire - Direktur Jenderal Permasyarakatan Kementerian Imigrasi dan Permasyarakatan (Dirjenpas Kemenimipas), Mashudi, mengecek Lapas Kelas II-B Nabire, Papua Tengah, setelah kejadian 19 narapidana (napi) kabur dan menyerang petugas lapas atau sipir. Dia juga menjenguk tiga sipir yang terluka akibat serangan senjata tajam oleh para napi.<br>\"Kami tadi meminta penjelasan kronologi kejadian, fakta-fakta dan data-data yang telah dikumpulkan pihak lapas terkait kejadian ini. Dan juga kami melakukan pengecekan terhadap sistem keamanan di Lapas Nabire ini,\" kata Mashudi kepada detikcom, Selasa (3/6/2025).<br><br>Mashudi mengatakan dia juga mendengarkan paparan soal upaya yang telah dilakukan Lapas Kelas IIB Nabire terkait menjaga kekondusifan lapas. Mashudi juga menekankan soal koordinasi dan sinergi dengan aparat TNI-Polri.<br><br></div>\";s:5:\"image\";s:62535:\"[\"data:image\\/jpeg;base64,\\/9j\\/4AAQSkZJRgABAQEAYABgAAD\\\\/4QQZaHR0cDovL25zLmFkb2JlLmNvbS94YXAvMS4wLwA8P3hwYWNrZXQgYmVnaW49J++7vycgaWQ9J1c1TTBNcENlaGlIenJlU3pOVGN6a2M5ZCc\\\\/9sAQwAHBQUGBQQHBgUGCAcHCAoRCwoJCQoVDxAMERgVGhkYFRgXGx4nIRsdJR0XGCIuIiUoKSssKxogLzMvKjInKisq\\/9sAQwEHCAgKCQoUCwsUKhwYHCoqKioqKioqKio