/KiitHsVE52Dq30\\/rWrZf8AH5D\\/ALy\\/zoorPoWfWB\\/49V\\/3VqKXqfpRRXKUZ1x938aZN90fSiigQwf6s\\/SoLfv9aKKACT74\\/Grcf+r\\/AAoooAqXHRv92oE\\/5Bjf71FFbrYkiX7o+lFFFSM\\/\\/9k=\"]\";s:10:\"created_at\";s:19:\"2026-02-12 11:32:15\";s:10:\"updated_at\";s:19:\"2026-02-12 11:32:15\";}s:11:\"\0*\0original\";a:8:{s:2:\"id\";i:151;s:6:\"status\";s:9:\"published\";s:5:\"title\";s:78:\"Dirjenpas Cek Lapas Nabire Usai 19 Napi Kabur, Jenguk Sipir Korban Penyerangan\";s:4:\"slug\";s:77:\"dirjenpas-cek-lapas-nabire-usai-19-napi-kabur-jenguk-sipir-korban-penyerangan\";s:7:\"content\";s:848:\"<div>Nabire - Direktur Jenderal Permasyarakatan Kementerian Imigrasi dan Permasyarakatan (Dirjenpas Kemenimipas), Mashudi, mengecek Lapas Kelas II-B Nabire, Papua Tengah, setelah kejadian 19 narapidana (napi) kabur dan menyerang petugas lapas atau sipir. Dia juga menjenguk tiga sipir yang terluka akibat serangan senjata tajam oleh para napi.<br>\"Kami tadi meminta penjelasan kronologi kejadian, fakta-fakta dan data-data yang telah dikumpulkan pihak lapas terkait kejadian ini. Dan juga kami melakukan pengecekan terhadap sistem keamanan di Lapas Nabire ini,\" kata Mashudi kepada detikcom, Selasa (3/6/2025).<br><br>Mashudi mengatakan dia juga mendengarkan paparan soal upaya yang telah dilakukan Lapas Kelas IIB Nabire terkait menjaga kekondusifan lapas. Mashudi juga menekankan soal koordinasi dan sinergi dengan aparat TNI-Polri.<br><br></div>\";s:5:\"image\";s:62535:\"[\"data:image\\/jpeg;base64,\\/9j\\/4AAQSkZJRgABAQEAYABgAAD\\\\/4QQZaHR0cDovL25zLmFkb2JlLmNvbS94YXAvMS4wLwA8P3hwYWNrZXQgYmVnaW49J++7vycgaWQ9J1c1TTBNcENlaGlIenJlU3pOVGN6a2M5ZCc\\\\/9sAQwAHBQUGBQQHBgUGCAcHCAoRCwoJCQoVDxAMERgVGhkYFRgXGx4nIRsdJR0XGCIuIiUoKSssKxogLzMvKjInKisq\\/9sAQwEHCAgKCQoUCwsUKhwYHCoqKioqKioqKioqKioqKioqKioqKioqKioqKioqKioqKioqKioqKioqKioqKioqKioq\\/8AAEQgBcQJiAwEiAAIRAQMRAf\\/EAB8AAAEFAQEBAQEBAAAAAAAAAAABAgMEBQYHCAkKC\\/\\/EALUQAAIBAwMCBAMFBQQEAAABfQECAwAEEQUSITFBBhNRYQcicRQygZGhCCNCscEVUtHwJDNicoIJChYXGBkaJSYnKCkqNDU2Nzg5