(151, 'published', 'Dirjenpas Cek Lapas Nabire Usai 19 Napi Kabur, Jenguk Sipir Korban Penyerangan', 'dirjenpas-cek-lapas-nabire-usai-19-napi-kabur-jenguk-sipir-korban-penyerangan', '<div>Nabire - Direktur Jenderal Permasyarakatan Kementerian Imigrasi dan Permasyarakatan (Dirjenpas Kemenimipas), Mashudi, mengecek Lapas Kelas II-B Nabire, Papua Tengah, setelah kejadian 19 narapidana (napi) kabur dan menyerang petugas lapas atau sipir. Dia juga menjenguk tiga sipir yang terluka akibat serangan senjata tajam oleh para napi.<br>\"Kami tadi meminta penjelasan kronologi kejadian, fakta-fakta dan data-data yang telah dikumpulkan pihak lapas terkait kejadian ini. Dan juga kami melakukan pengecekan terhadap sistem keamanan di Lapas Nabire ini,\" kata Mashudi kepada detikcom, Selasa (3/6/2025).<br><br>Mashudi mengatakan dia juga mendengarkan paparan soal upaya yang telah dilakukan Lapas Kelas IIB Nabire terkait menjaga kekondusifan lapas. Mashudi juga menekankan soal koordinasi dan sinergi dengan aparat TNI-Polri.<br><br></div>', '[\"data:image\\/jpeg;base64,\\/9j\\/4AAQSkZJRgABAQEAYABgAAD\\\\/4QQZaHR0cDovL25zLmFkb2JlLmNvbS94YXAvMS4wLwA8P3hwYWNrZXQgYmVnaW49J++7vycgaWQ9J1c1TTBNcENlaGlIenJlU3pOVGN6a2M5ZCc\\\\/9sAQwAHBQUGBQQHBgUGCAcHCAoRCwoJCQoVDxAMERgVGhkYFRgXGx4nIRsdJR0XGCIuIiUoKSssKxogLzMvKjInKisq\\/9sAQwEHCAgKCQoUCwsUKhwYHCoqKioqKioqKioqKioqKioqKioqKioqKioqKioqKioqKioqKioqKioqKioqKioqKioq\\/8AAEQgBcQJiAwEiAAIRAQMRAf\\/EAB8AAAEFAQEBAQEBAAAAAAAAAAABAgMEBQYHCAkKC\\/\\/EALUQAAIBAwMCBAMFBQQEAAABfQECAwAEEQUSITFBBhNRYQcicRQygZGhCCNCscEVUtHwJDNicoIJChYXGBkaJSYnKCkqNDU2Nzg5OkNERUZHSElKU1RVVldYWVpjZGVmZ2hpanN0dXZ3eHl6g4SFhoeIiYqSk5SVlpeYmZqio6Slpqeoqaqys7S1tre4ubrCw8TFxsfIycrS09TV1tfY2drh4uPk5ebn6Onq8fLz9PX29\\/j5+v\\/EAB8BAAMBAQEBAQEBAQEAAAAAAAABAgMEBQYHCAkKC\\/\\/EALURAAIBAgQEAwQHBQQEAAECdwABAgMRBAUhMQYSQVEHYXETIjKBCBRCkaGxwQkjM1LwFWJy0QoWJDThJfEXGBkaJicoKSo1Njc4OTpDREVGR0hJSlNUVVZXWFlaY2RlZmdoaWpzdHV2d3h5eoKDhIWGh4iJipKTlJWWl5iZmqKjpKWmp6ipqrKztLW2t7i5usLDxMXGx8jJytLT1NXW19jZ2uLj5O