(152, 'published', 'Selama 8 Bulan Terakhir, Sudah 4 WBP Lapas Kelas IIB Tuban yang Meninggal Dunia, Ini Penyebabnya', 'selama-8-bulan-terakhir-sudah-4-wbp-lapas-kelas-iib-tuban-yang-meninggal-dunia-ini-penyebabnya', '<div><strong>SURYA.CO.ID, TUBAN </strong>- Tak sampai setahun, sudah 4 Warga Binaan Pemasyarakatan (WBP) <a href=\"https://surabaya.tribunnews.com/tag/lapas-kelas-iib-tuban\">Lapas Kelas IIB Tuban</a>, Jawa Timur (Jatim), yang meninggal dunia.</div><div>Terakhir, napi perempuan bernama Yulia (24) warga asal Desa Kembangbilo, Kecamatan/Kabupaten <a href=\"https://surabaya.tribunnews.com/tag/tuban\">Tuban</a>, meninggal dunia di RSUD dr R. Koesma pada Selasa (13/5/2025).&nbsp;</div><div>Tercatat dalam kurun waktu 8 bulan terakhir, sudah 4 WBP meninggal dunia di Lapas Kelas IIB Tuban.</div><div><br><br></div>', '[\"data:image\\/jpeg;base64,\\/9j\\/4AAQSkZJRgABAQEAYABgAAD\\\\/4QQZaHR0cDovL25zLmFkb2JlLmNvbS94YXAvMS4wLwA8P3hwYWNrZXQgYmVnaW49J++7vycgaWQ9J1c1TTBNcENlaGlIenJlU3pOVGN6a2M5ZCc\\\\/9sAQwAHBQUGBQQHBgUGCAcHCAoRCwoJCQoVDxAMERgVGhkYFRgXGx4nIRsdJR0XGCIuIiUoKSssKxogLzMvKjInKisq\\/9sAQwEHCAgKCQoUCwsUKhwYHCoqKioqKioqKioqKioqKioqKioqKioqKioqKioqKioqKioqKioqKioqKioqKioqKioq\\/8AAEQgBqAJTAwEiAAIRAQMRAf\\/EAB8AAAEFAQEBAQEBAAAAAAAAAAABAgMEBQYHCAkKC\\/\\/EALUQAAIBAwMCBAMFBQQEAAABfQECAwAEEQUSITFBBhNRYQcicRQygZGhCCNCscEVUtHwJDNicoIJChYXGBkaJSYnKCkqNDU2Nzg5OkNERUZHSElKU1RVVldYWVpjZGVmZ2hpanN0dXZ3eHl6g4SFhoeIiYqSk5SVlpeYmZqio6Slpqeoqaqys7S1tre4ubrCw8TFxsfIycrS09TV1tfY2drh4uPk5ebn6Onq8fLz9PX29\\/j5+v\\/EAB8BAAMBAQEBAQEBAQEAAAAAAAABAgMEBQYHCAkKC\\/\\/EALURAAIBAgQEAwQHBQQEAAECdwABAgMRBAUhMQYSQVEHYXETIjKBCBRCkaGxwQkjM1LwFWJy0QoWJDThJfEXGBkaJicoKSo1Njc4OTpDREVGR0hJSlNUVVZXWFlaY2RlZmdoaWpzdHV2d3h5eoKDhIWGh4iJipKTlJWWl5iZmqKjpKWmp6ipqrKztLW2t7i5usLDxMXGx8jJytLT1NXW19jZ2uLj5OXm5+jp6vLz9PX29\\/j5+v\\/aAAwDAQACEQMRAD8A8dvZLG\\/t3LR+RcryARjNUdPO5sLFnHerl9qU4jMWo2SJOeBIABmm6Xa3lvFuMKsG6YajQDQimZQAEz7HirCSOw4t4+fU1CPtGPmtx\\/30KXNwefsrHH+0KNBFiMOjZWGLntUyu4JzBHz7VSWe4H\\/Lq351Mt